    return (
        <div>
            <p>
                Elevate your 
            </p>
            <TypewriterEffect options={{
                strings: ['Academics', 'Interests', 'Passion', 
                'Career', 'Mind', 'Curiosity'],
                autoStart: true,
                loop: true,
                delay: 60,
            }} />
          </div>
    );
}




export default Typewriter;
